import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Divider from '@material-ui/core/Divider'
import { withStyles } from '@material-ui/core/styles'

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
  },

  contentContainer: {
    alignItems: 'center',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    height: '80px',
    width: '100%'
  },

  leftContent: {
    display: 'flex',
    flexDirection: 'column',
  },

  topLeftContent: {
    fontSize: '15px',
    margin: '0 0 5px 0'
  },

  bottomLeftContent: {
    fontSize: '12px'
  },

  rightContent: {
    alignItems: 'center',
    display: 'flex',
    flexDirection: 'column',
    fontSize: '15px',
    fontWeight: 700
  }
}

class Deposit extends Component {
  state = {
  }

  render() {
    const { classes, deposit } = this.props

    return (
      <div className={classes.container}>
        <div className={classes.contentContainer}>
          <div className={classes.leftContent}>
            <div className={classes.topLeftContent}>{deposit.date} - {deposit.confirmed ? 'Confirmed' : 'Pending'}</div>
             <div className={classes.bottomLeftContent}>{deposit.from}</div>
          </div>
          <div className={classes.rightContent}>
            {deposit.amount} Sats
        </div>
        </div>
        <Divider />
      </div>
    )
  }
}

Deposit.propTypes = {
  classes: PropTypes.object.isRequired
}

export default withStyles(styles)(Deposit)
